import React, { memo, useState, useEffect } from "react";

import { Button } from "@rmwc/button"

import '@rmwc/button/styles';

/*
 Agent Control Component

  props:
     resetAction
     pauseAction
     playAction
 */
function AgentControl(props) {
  return (
    <div >
      <h1>Agent Control</h1>
      <Button label="Play" />
      <Button label="Pause" />
      <Button label="Reset" />
    </div>
  );
}

export default memo(AgentControl);
